import * as React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';

const Main:React.FC = () => {
  return (
    <BrowserRouter>
    <Switch>
      <Route path="/" exact component={Main} />
    </Switch>
  </BrowserRouter>
  );
}

export default Main;
